Как работает технология Volkswagens Emergency Assist в случае, если водитель заснул или с ним что-то случилось.

У меня в прокатной Cupra Formentor была похожая система. Я как-то на пустой трассе проверил, как она работает: перестал касаться руля при включенном ассистенте вождения и стал смотреть, что будет. Машина сначала сигнализировала о том, что водитель должен срочно взять под контроль руль, а потом включила аварийные огни и стала постепенно притормаживать, смещаясь к обочине правой полосы, пока не остановилась совсем. Дальше я не стал проверять - может, она бы и в Службу спасения позвонила.&nbsp;


&nbsp;

А эта Божена еще смешнее, чем я думал...



Она у меня лет семь, что ли, назад в друзья на Facebook просилась. Я еще подумал, чего это она?&nbsp;

А теперь понимаю, что это и вовсе было что-то странное, ведь у меня нет галочки синей в Facebook, мне синяя галочка ни на фиг не сдалась, я же не элита фейсбука, в отличие от Божены Рынской (она вообще-то Женя Курицына, как известно, но сути дела это не меняет: каждый имеет право изменить имя и фамилию, ведь я, как известно, и вовсе Петя Лисичкин).

(смахивая непрошенную слезу) Как сказал, как сказал! &quot;Хозяин сказал, журналист прыгнул - это к Тверской&quot;! &quot;Журналист - всегда независимый человек!&quot; Ну и &quot;Нельзя позволять хамам брать власть над собой&quot;!

Вот он - совесть журналистики!


&nbsp;

